import {BottomNavigation, makeStyles} from '@material-ui/core'
import {GitHub, LinkedIn, Twitter} from '@mui/icons-material'
import {BottomNavigationAction} from '@mui/material'
import React from 'react'

const useStyles = makeStyles({
     bottomNavContainer: {
          background: "#222"
     },
     root1: {
          "& .MuiSvgIcon-root": {
               fill: "tan",
               "&:hover": {
                    fill: "tomato",
                    fontSize: "1.8rem"
               }
          }
     },
     root2: {
          "& .MuiSvgIcon-root": {
               fill: "tan",
               "&:hover": {
                    fill: "tomato",
                    fontSize: "1.8rem"
               }
          }
     },
     root3: {
          "& .MuiSvgIcon-root": {
               fill: "tan",
               "&:hover": {
                    fill: "tomato",
                    fontSize: "1.8rem"
               }
          }
     }
});

const Footer = () => {
     const classes = useStyles();
     return (
          <BottomNavigation className={
               classes.bottomNavContainer
          }>
               <BottomNavigationAction icon={<Twitter/>}
                    className={
                         classes.root
                    }/>
               <BottomNavigationAction icon={<GitHub/>}
                    className={
                         classes.root
                    }/>
               <BottomNavigationAction icon={<LinkedIn/>}
                    className={
                         classes.root
                    }/>
          </BottomNavigation>
     )
}

export default Footer
